import React from 'react'
import SearchIcon from '@material-ui/icons/Search';

export default function Search() {
  return (
    <div style={{display: "flex", alignItems: "center", justifyContent: "center"}}>
      <div style={{backgroundColor: "#f5f5f5", width: 300, height: 30, borderRadius: 25, padding: 5}}>
        <input type="text" name="name"
          style={{backgroundColor: "transparent", border: "none", outline: "none", width: '100%', height: '100%'}}
        />
      </div>
      <div style={{backgroundColor: "lightgreen", height: 40, width: 40, borderRadius: 30, marginLeft: 10, display: "flex", justifyContent: "center", alignItems: "center"}}>
        <SearchIcon style={{color: "white"}}/>
      </div>
    </div>
  )
}
